window.bookSummaryJSON = "<p>Jeff Kinney’s tales featuring wise-cracking middle schooler Greg Heffley have reached number-one on the <i>New York Times</i> best-seller list, inspired a major motion picture, and been translated into dozens of languages. Greg has endured countless horrors—girls, bullies, jocks, oblivious parents, wrestling in gym class, even the dreaded Cheese Touch—the past few years. But everything changes in this fifth hilarious adventure.</p>"; 
